/*___________________________________________
CODE ASSET OF SAMUEL ROBENS-PARADISE © 2018
DISTRIBUTION OF CODE WITHOUT WRITTEN CONSENT OF
SAMUEL ROBENS-PARADISE IS PROHIBITED UNLESS
ACCESSED THROUGH PUBLIC DOIMAIN SUCH AS GITHUB
OR ANY OTHER OPEN SOURCE PLATFORM ON WHICH ASSET
WAS PUBLISHED WITH AUTHOR CONSENT
*/
import React, { Component } from 'react';
import Navigation from './Navigation';
import App from './App';
import './Landing.css';
import './App.css';
import './assets/inkstain.svg';
import './assets/nextArrowBefore.svg'
import './assets/nextArrowAfter.svg'
import BullyMasked from './img/BullyMasked.png';
import NerdyMasked from './img/NerdyMasked.png';
import FancyMasked from './img/FancyMasked.png';
import StunningMasked from './img/StunningMasked.png';
import { Container, Row, Col } from 'reactstrap';

class Landing extends Component {
  //landing constructor...
  constructor(props){
    super(props);
    this.state = { Images:[
      BullyMasked,
      NerdyMasked,
      FancyMasked,
      StunningMasked
    ],
    current: 0,
    isNext: true
    };
    this.handleNext =this.handleNext.bind(this);
  };
  //handles carousel onClick...
   handleNext(){
     let index = this.state.current,
     length  = this.state.Images.length-1;
     if(index === length){
       index = -1;
     }
      index = index+1;

      this.setState({
        current: index,
        isNext: true
      });
     }
  //render function
  render() {
    //create local variable that inherits the current state of class variables...
    let index = this.state.current;
    let isNext= this.state.isNext;
    let src = this.state.Images[index];
    //generating global variables for use in landing....
    var exploreBtntxt = "Explore"
    //generating local css object...
    var localCSSclasses = { cssClass:[
      'inkstain',
      'herotitle',
      'heroleft',
      'heroright', 
      'EmilyBandelImg',
      'taverseCarouselbtn',
      'explore_Contributions_btn',
      'ebname',
      'ebtitle',
      'vancouver',
      'seperationbar'
    ],
  getCssClass: function(arrayIndex){
    return this.cssClass[arrayIndex];
  }
  };
    //generating local variables for use in landing...
    let {EmilyInfo} = this.props;
    let headerPhoto = <img className={localCSSclasses.getCssClass(4)} src={src} alt={src.toString()+isNext}/>
    let nextButton = <div className={localCSSclasses.getCssClass(5)} onClick={this.handleNext} alt="Next Image"></div>
    let exploreButton = <button className={localCSSclasses.getCssClass(6)}><h3><span>{exploreBtntxt}</span></h3></button>
    let navigationBar = <Navigation/>
    let ebname = <h1 className={localCSSclasses.getCssClass(7)}><span>{EmilyInfo.firstName+" "+EmilyInfo.lastName}</span></h1>
    let ebtitle = <h2 className={localCSSclasses.getCssClass(8)}><span>{EmilyInfo.title}</span></h2>
    let location = <h2><span>{EmilyInfo.city}, {EmilyInfo.province}</span></h2>

    //return function as follows appears physcially to user
    return (
     <div className={localCSSclasses.getCssClass(0)}>
      {navigationBar}
      <Row className={localCSSclasses.getCssClass(1)}>
      <Col xs="4" className={localCSSclasses.getCssClass(2)}>
      <Container>
      {console.log(localCSSclasses.getCssClass(5))}
      </Container>
      </Col>
      <Col xs="4">
      {ebname}      
      {ebtitle}
      {exploreButton}
      </Col>
      <Col xs="4" className={localCSSclasses.getCssClass(3)}>
      <Container>
      <div id="container">
      {headerPhoto}
      {nextButton}
      </div>
      </Container>
      </Col>
      </Row> 
     <Container><Row className={localCSSclasses.getCssClass(9)}>
      <Col xs="12">
      {location}
      </Col>
      </Row>
      </Container>
      <Container>
      <Row>
        <Col>
        <div className={localCSSclasses.getCssClass(10)}></div>
        </Col>
      </Row>
      </Container>
     </div>
    );
  }
}

export default Landing;
